import logo from './logo.svg';
import {useReducer} from "react";
//import './App.css';

const ACTIONS = {
    ADD_DIGIT: 'add'
}

function reducer(state, {type, payload}){

}

function App() {
    const [{currentOperand, previousOperand, operation}, dispatch] = useReducer(reducer, {})
    return (
        <div className="calculator-display">

            <div className="calculator-operation-output">

                <div className="previous-operand">{previousOperand} {operation}</div>
                <div className="current-operand">{currentOperand}</div>

                 </div>

            <div className="calculator-grid">

                        <button class="button-display top">AC</button>
                        <button class="button-display top">+/-</button>
                        <button className="button-display top">%</button>
                        <button className="button-display right">รท</button>

                        <button className="button-display center">7</button>
                        <button className="button-display center">8</button>
                        <button className="button-display center">9</button>
                        <button className="button-display right">x</button>

                        <button className="button-display center">4</button>
                        <button className="button-display center">5</button>
                        <button className="button-display center">6</button>
                        <button className="button-display right">-</button>

                        <button className="button-display center">1</button>
                        <button className="button-display center">2</button>
                        <button className="button-display center">3</button>
                        <button className="button-display right">+</button>

                        <button className="button-display center zero">0</button>
                        <button className="button-display center">.</button>
                        <button className="button-display right">=</button>

            </div>
        </div>



    )

}

export default App;
